script: |
  super -f text -I q269.spq | sort > q269.out

inputs:
  - name: q269.spq
    data: |
      SELECT - 96 * col0 FROM tab1 (FORMAT parquet) WHERE - + col0 * - + col0 + + col0 + + - ( + col0 ) * 27 - ( col1 ) IS NOT NULL;
  - name: tab1

outputs:
  - name: q269.out
    data: |
      -4896
      -8160
      -8736
